import React from "react";
import './Card.css';

export default function Card({name, image, height_min, height_max, weight_min, weight_max }){
    return (
        <div className>                
            <p className='titulo-card' >{name}</p>
            <img src = {image.url} alt='img not found' width = '200px' height ='250px'/>
            <h1>Peso minimo: {weight_min}</h1>
            <h6>Peso maximo: {weight_max}</h6>
            <h6>Altura minima: {height_min}</h6>
            <h6>Altura maxima: {height_max}</h6>
        </div>
    );
}
